import React from "react";
import { useNavigate } from "react-router-dom";

interface Props {}

export default function Home(props: Props) {
  console.log("first", props);
  const navigate = useNavigate();

  const onClick = () => {
    navigate("/room");
  };
  return (
    <>
      <div>Home</div>
      <button onClick={onClick}>click</button>
    </>
  );
}
